    "Towards Accelerated Aging Methodologies and Health Management of Power MOSFETs",nt"tracking_summary":
    {ntt"total": 1,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-02-26T22:03:47.718515",nt"name": "towards-accelerated-aging-methodologies-and-health-management-of-power-mosfets",nt"isopen":
    true,nt"url": null,nt"notes": "Understanding aging mechanisms of electronic
    components is of extreme importance in the aerospace domain where they are part
    of numerous critical subsystems including avionics. In particular, power MOSFETs
    are of special interest as they are involved in high voltage switching circuits
    such as drivers for electrical motors. With increased use of electronics in aircraft
    control, it becomes more important to understand the degradation of these components
    in aircraft specific environments. In this paper, we present an accelerated aging
    methodology for power MOSFETs that subject the devices to indirect thermal overstress
    during high voltage switching. During this accelerated aging process, two major
    modes of failure were observed u2013 latch-up and die attach degradation. In this
    paper we present the details of our aging methodology along with details of experiments
    and analysis of the results.",nt"license_title": "U.S. Government Work",nt"extras":
